    // You can perform your API call here with the 'query' parameter.
    // For simplicity, let's just log the query to the console.
    console.log(`Searching for: ${query}`);
  };

  return (
    <div>
      <h1>Stock Grapher</h1>
      <SearchBox onSearch={handleSearch} />
